import React from 'react';

const Intro = () => {
    return (
        <div className="intro-container" id="intro">
            <div className="my-name-is">Welcome! My name is</div>
            <div className="ethan">Ethan Reinhart.</div>
            <div className="what-i-love">I love to improve efficiency with AI applications.</div>
            <div className="what-i-do">I'm currently working to create a non-profit start-up to benefit higher-education in Oregon, but am always looking for a new challenge!</div>
        </div>
      );
}

export default Intro;
